import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { Responsive as ResponsiveGridLayout } from 'react-grid-layout';
import './Home.css';
import '/node_modules/react-grid-layout/css/styles.css';
import '/node_modules/react-resizable/css/styles.css';

const Home = () => {
  const [layout, setLayout] = useState([]);
  const [widgets] = useState([
    { id: 'progress', component: ProgressBox },
    { id: 'recent', component: ActivityCard },
    { id: 'upcoming', component: UpcomingTasks },
    { id: 'goals', component: UserInputCard }
  ]);

  // Load layout from localStorage
  useEffect(() => {
    const savedLayout = localStorage.getItem('dashboardLayout');
    if (savedLayout) {
      setLayout(JSON.parse(savedLayout));
    }
  }, []);

  // Save layout to localStorage
  const saveLayout = (newLayout) => {
    localStorage.setItem('dashboardLayout', JSON.stringify(newLayout));
  };

  const handleLayoutChange = (newLayout) => {
    setLayout(newLayout);
    saveLayout(newLayout);
  };

  const defaultLayout = [
    { i: 'progress', x: 0, y: 0, w: 3, h: 2, minW: 2, minH: 2 },
    { i: 'recent', x: 3, y: 0, w: 2, h: 2, minW: 2, minH: 2 },
    { i: 'upcoming', x: 0, y: 1, w: 2, h: 2, minW: 2, minH: 2 },
    { i: 'goals', x: 2, y: 1, w: 3, h: 2, minW: 2, minH: 2 }
  ];

  const ProgressBox = () => (
    <div className="progress-box">
      <h3>Overall Progress</h3>
      <div className="progress-bar">
        <div className="filled" style={{ width: '60%' }}></div>
      </div>
      <p>60% Complete</p>
    </div>
  );

  const ActivityCard = () => (
    <div className="activity-card">
      <h3>Recent Activity</h3>
      <ul>
        <li>Completed Module 1</li>
        <li>Finished Practice Quiz</li>
      </ul>
    </div>
  );

  const UpcomingTasks = () => (
    <div className="activity-card">
      <h3>Upcoming Tasks</h3>
      <ul>
        <li>Complete Module 2</li>
        <li>Review Lesson 4</li>
      </ul>
    </div>
  );

  const UserInputCard = () => (
    <div className="user-input-card">
      <h3>Set Learning Goals</h3>
      <input type="text" placeholder="Enter your goal" />
      <button>Save</button>
    </div>
  );

  return (
    <div className="page-content home">
      <div className="nav-bar">
        <Link to="/progress">Progress Tracking</Link>
        <Link to="/recommended-resources">Recommended Resources</Link>
        <Link to="/feedback">Feedback</Link>
        <Link to="/profile">Profile</Link>
      </div>

      <h2>Welcome, Student!</h2>

      <ResponsiveGridLayout
        className="layout"
        layouts={{ lg: layout.length ? layout : defaultLayout }}
        breakpoints={{ lg: 1200 }}
        cols={{ lg: 12 }}
        rowHeight={100}
        width={1200}
        onLayoutChange={handleLayoutChange}
        draggableHandle=".widget-header"
      >
        {widgets.map((widget) => (
          <div key={widget.id} className="widget">
            <div className="widget-header">
              <span>â‰¡</span>
            </div>
            <widget.component />
          </div>
        ))}
      </ResponsiveGridLayout>
    </div>
  );
};

export default Home;
